          </Box>
          <Box textAlign="center" paddingTop={3}>
            <Typography variant="body2">
              ㈜닥터크린은 서울 및 수도권 청소와 방역,소독 서비스 전문 업체로서
              사람과 환경을 생각하며,
            </Typography>
            <Typography variant="body2">
              고객분들의 공간이 더 가치가 있도록 만들기 위한 최선의 노력을
              제공하고 있습니다.
            </Typography>
          </Box>
        </Box>
      </Box>
    </Layout>
  );
};

export default Index;
